VALUES ('8007990406982', 'Hulala chantilly', 'FR VEGETALES SPECIAL PATISSERIE PREPARATION A BASE DE GRAISSES LONGUE CONSERVATION UHT Modalités d\'utilisation: Pour garantir le meilleur résultat, avant le montage, il est conseillé de-laisser le produit au réfrigérateur pendant au moins 3 heures. Le produit se foisonne à une température comprise entre 8 et 12 °C, tel quel, en ajoutant de la crème ou jusqu\'à 30% de lait entier Ingrédients: Eau, Graisses végétales hydrogénées (26%), Sucre (11%), Protéines du lait, Stabilisateurs: E420ii, E463, Agents émulsifiants: E472e, Lécithine de soja (E322), E472b, Sel, Arômes, Colorant: E160a. Conservation: Se conserve à température ambiante non supérieure à 20 °C. Une fois ouvert le produit doit être conservé au réfrigérateur et consommé dans les 3 à 4 jours. Tenir le produit a l\'abri de sources de chaleur. MIX Board', '', '', '', '', '', '', '', '', '', '', '1');

